"use strict";const common_vendor=require("../common/vendor.js");const permissionList=["/pages/confirm/confirm","/pages/mine/mine"];const apis=["navigateTo","switchTab","redirectTo","reLaunch","navigateBack"];apis.forEach((api=>{common_vendor.index.addInterceptor(api,{invoke(arg){const{url:url}=arg;if(permissionList.includes(url)){const token=common_vendor.index.getStorageSync("token");if(!token){common_vendor.index.navigateTo({url:"/pages/login/login"});return false}}}})}));
